import { useEffect, useState } from 'react';
import './App.css';
import AdicionaTask from './AdiconaTask';
import Tasks from './Tasks';

function App() {
const [tipo, setTipo] = useState(true);
  return (
    <div>
    <button>Editar tarefa</button>
    {!tipo ? <p>Editar</p> :
      <AdicionaTask />
    }
      <Tasks />
    </div>
  );
}

export default App;
